import React from 'react';

const IconEyeOpened = ({ onClick = () => {} }) => {
  return (
    <>
      <svg
        onClick={onClick}
        xmlns='http://www.w3.org/2000/svg'
        className='absolute w-6 h-6 top-[50%] translate-y-[-50%] right-2 cursor-pointer'
        fill='none'
        viewBox='0 0 24 24'
        stroke='currentColor'
      >
        <path
          strokeLinecap='round'
          strokeLinejoin='round'
          strokeWidth={2}
          d='M15 12a3 3 0 11-6 0 3 3 0 016 0z'
        />
        <path
          strokeLinecap='round'
          strokeLinejoin='round'
          strokeWidth={2}
          d='M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z'
        />
      </svg>
    </>
  );
};
export default IconEyeOpened;
